import React from 'react';

const OfferTracking = () => {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-12">
          <div className="card">
            <div className="card-header">
              <h4 className="card-title">Offer Tracking</h4>
            </div>
            <div className="card-body">
              <p>This is the Offer Tracking page. Content will be implemented here.</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default OfferTracking;
